INSERT INTO [dbo].[Prodotti] ([IdProdotto], [ModelloProdotto], [ImmagineProdotto], [DescrizioneProdotto], [MarcaProdotto], [IdCategoria], [IdFornitore], [Prezzo], [QtaGiacenza], [ValProdotto]) VALUES (1, 'MateBook D', 'HuaweiMateBookD.jpg', 'Design estetico:display fullview, con un rapporto schermo-corpo dell'' 87%.esperienza di visione immersiva offerta da un display antiriflesso con proporzioni 16:9corpo metallico con un tocco futuristicouno spessore di 16.9 mmtecnologia innovativa：amd ryzen5 3500u, con scheda grafica radeon vega 8le ventole shark fin 2.0 rendono la dissipazione del calore più silenziosa ed efficaceexpandable storage with an ssd+hdd supports faster response speed and larger storagela memoria endibile con ssd+hdd supporta una velocità di risposta più elevata e una memoria più ampiail caricabatterie USB-c compatto supporta la ricarica rapidaesperienza smart:collaborazione multi-schermo per facilitare il lavoro e la vitasensore d''impronte digitali per accensione e accesso velocidisplay certificato tüv rheinland per proteggere gli occhi riducendo la luce blufotocamera a scomparsa per un miglior controllo.', 'Huawei', 1, 1, 500, 20, ' ');
INSERT INTO [dbo].[Prodotti] ([IdProdotto], [ModelloProdotto], [ImmagineProdotto], [DescrizioneProdotto], [MarcaProdotto], [IdCategoria], [IdFornitore], [Prezzo], [Sconto], [QtaGiacenza], [ValProdotto]) VALUES (2, 'AirMax', 'AirMax.jpg', 'La scarpa Nike Air Max 90 offre un''ammortizzazione straordinaria grazie all''unità Air-Sole visibile nel tallone. Il sostegno e la resistenza sono garantiti grazie alla tomaia in pelle, alla caviglia rinforzata e agli occhielli supplementari che conferiscono alla scarpa una vestibilità comoda, confortevole e personalizzata. Infine, la suola in gomma con design goffrato offre la massima aderenza e resistenza.', 'Nike', 4, 2, 100, 5, 10, ' ');
INSERT INTO [dbo].[Prodotti] ([IdProdotto], [ModelloProdotto], [ImmagineProdotto], [DescrizioneProdotto], [MarcaProdotto], [IdCategoria], [IdFornitore], [Prezzo], [QtaGiacenza], [ValProdotto]) VALUES (3, 'Beta 903E/C98', 'Beta.jpg', 'Assortimento di 45 chiavi a bussola esagonali, 35 inserti per avvitatori, 4 chiavi maschio esagonale piegata e 14 accessori in cassetta di plastica il kit comprende: cricchetto reversibile con attacco maschio da 1/4" chiavi a bussola da 1/4" snodo da 1/4" prolunga da 1/4" giravite con attacco quadro da 150 mm chiavi a brugola piegate innesto da 1/4" quadro a 1/4" esagonale inserti per avvitatori: taglio, a croce phillips, pozidriv, esagonali, torx da 1/4" dimensioni: 375x295x84 mm peso: 8.0kg.', 'Beta', 3, 3, 118.34, 5, ' ');
